INSERT INTO `t_plague` VALUES ('2', '鼠疫', '1', '2019-12-31 22:25:55');
INSERT INTO `t_plague` VALUES ('3', '雅典瘟疫', '1', '2019-12-31 22:26:55');
INSERT INTO `t_plague` VALUES ('4', '流感', '1', '2019-12-18 22:27:21');
INSERT INTO `t_plague` VALUES ('5', '狂犬病', '1', '2019-12-18 22:28:11');
INSERT INTO `t_plague` VALUES ('6', '天花', '1', '2019-12-09 22:29:24');
INSERT INTO `t_plague` VALUES ('7', '结核病', '1', '2019-12-31 14:43:21');
INSERT INTO `t_plague` VALUES ('9', '登革热病毒', '1', '2020-01-01 02:15:42');
INSERT INTO `t_plague_info` VALUES ('1', '1', '1', '2019-12-31 22:04:48', '黑死病是人类历史上最致命的瘟疫之一，它造成世界死亡人数高达7500万。黑死病是由黑鼠皮毛内的蚤携带细菌造成的，患了黑死病的人皮肤会出现很多黑色斑块，故被人称为“黑死病”。');
INSERT INTO `t_plague_info` VALUES ('2', '2', '1', '2019-12-24 22:26:10', '中国云南省一场重大鼠疫始于1855年，这场瘟疫单在中国和印度就完成了1200万人的死亡。');
INSERT INTO `t_plague_info` VALUES ('3', '3', '1', '2019-12-31 22:27:05', '这场瘟疫几乎摧毁了整个雅典，患者会出现高烧，咽喉和舌头充血，散发着恶臭，并伴有剧烈咳嗽。后一位医生发现可以用火防疫，从而挽救了雅典。');
INSERT INTO `t_plague_info` VALUES ('4', '4', '1', '2019-12-18 22:27:31', '1658年意大利威尼斯一次流感大流行中致6万多人死亡，从19世纪到现在，流感已在世界多次发生大流行。其中危害和损失最大的一次要属1918年的世界性大流行，1918年的流感造成高达2千万的死亡人数。');
INSERT INTO `t_plague_info` VALUES ('5', '5', '1', '2019-12-24 22:28:27', '狂犬病是由狂兵病毒所致的急性传染，患者表现为怕水、怕风、咽肌痉挛、进行瘫痪，狂犬病患者死亡率高达100%，一般在3-6内死亡。');
INSERT INTO `t_plague_info` VALUES ('6', '6', '1', '2019-12-13 22:29:33', '天花是最古老也是死亡率最高的传染病之一，传染性强，主要通过飞沫吸入，直接接触传染。');
INSERT INTO `t_plague_info` VALUES ('7', '9', '1', null, '修改测试 登革热是由伊蚊传播所致的急性传染病，在20世纪，登革热在世界范围内发生的大流行中，患病人数高达数百万。');
